constexpr int kMax = 64946;
Node nodes[kMax + 1];
vector<int> edges[26];
int board[25];
int nidx;
void Insert(const string& s) {
int cnt = 0;
 for (auto c : s) cnt += (c >= 'a');
 auto node = nodes;
 for (auto c : s) {
 int x = c - 'A';
 bool out = false;
 if (x & 0x20) x ^= 0x20, out = true;
 if (node->nxt[x] == 0) node->nxt[x] = ++nidx;
 node = nodes + node->nxt[x];
 node->out |= out;
 node->cnt += cnt;
 cnt -= out;
 }
}
int Find(int u, int node, int visited) {
 int b = 1 << u;
 if (visited & b) return 0;
 visited |= b;
 int cut = 0;
 if (nodes[node].out) {
 nodes[node].out = false;
 ++cut;
 }
 for (auto v : edges[u]) {
 int nxt = nodes[node].nxt[board[v]];
 if (nxt == 0) continue;
 cut += Find(v, nxt, visited);
 if (nodes[nxt].cnt == 0) nodes[node].nxt[board[v]] = 0;
 }
 nodes[node].cnt -= cut;
 return cut;
}
int main() {
 ios::sync_with_stdio(false);
 cin.tie(nullptr);
 char* table = (char*)malloc(47051 + 1);
 table[47051] = '\0';
 d91(kTable, sizeof(kTable) - 1, table);
 auto out = zlib::dz(table, 47051, true);
 istringstream iss((const char*)out.data());
 string s;
 vector<string> strs;
 while (iss >> s) strs.push_back(s);
 Insert(strs[0]);
 for (int i = 1; i < strs.size(); i++) {
 auto& prv = strs[i - 1];
 auto& cur = strs[i];
 int head = cur.back() - 'A';
 cur.pop_back();
 cur.insert(cur.begin(), prv.begin(), prv.begin() + head);
 Insert(cur);
 }
 for (int i = 0; i < 5; i++) {
 for (int j = 0; j < 5; j++) {
 int u = i * 5 + j;
 for (int dy = -1; dy <= 1; dy++) {
 for (int dx = -1; dx <= 1; dx++) {
 int y = i + dy, x = j + dx;
 if (0 <= y && y < 5 && 0 <= x && x < 5) {
 int v = y * 5 + x;
 edges[u].push_back(v);
 }
 }
 }
 }
 }
 for (int i = 0; i < 25; i++) {
 char c;
 cin >> c;
 board[i] = c - 'A';
 edges[25].push_back(i);
 }
 nodes[0].cnt = UINT16_MAX;
 cout << Find(25, 0, 0);
 return 0;
}